    " to complete and submit the exam.": "\u05dc\u05d4\u05e9\u05dc\u05d9\u05dd \u05d5\u05dc\u05d4\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05d1\u05d7\u05df.",
