    "Don't see your picture? Make sure to allow your browser to use your camera when it asks for permission.": "\u05d0\u05d9\u05e0\u05da \u05e8\u05d5\u05d0\u05d4 \u05d0\u05ea \u05ea\u05de\u05d5\u05e0\u05ea\u05da? \u05d5\u05d3\u05d0 \u05db\u05d9 \u05d0\u05ea\u05d4 \u05de\u05d0\u05e4\u05e9\u05e8 \u05dc\u05d3\u05e4\u05d3\u05e4\u05df \u05e9\u05dc\u05da \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05e6\u05dc\u05de\u05d4 \u05db\u05d0\u05e9\u05e8 \u05de\u05ea\u05d1\u05e7\u05e9 \u05d0\u05d9\u05e9\u05d5\u05e8. ",
    "Donate": "\u05ea\u05e8\u05d5\u05dd",
    "Double-check that your webcam is connected and working to continue.": "\u05db\u05d3\u05d9 \u05dc\u05d4\u05de\u05e9\u05d9\u05da, \u05d0\u05e0\u05d0 \u05d5\u05d3\u05d0 \u05e9\u05de\u05e6\u05dc\u05de\u05ea \u05d4\u05d0\u05d9\u05e0\u05d8\u05e8\u05e0\u05d8 \u05e9\u05dc\u05da \u05de\u05d7\u05d5\u05d1\u05e8\u05ea \u05d5\u05e4\u05d5\u05e2\u05dc\u05ea.",
    "Download": "\u05d4\u05d5\u05e8\u05d3",
    "Download Software Clicked": "\u05d4\u05d5\u05e8\u05d3 \u05d0\u05ea \u05d4\u05ea\u05d5\u05db\u05e0\u05d4 \u05e9\u05e0\u05d1\u05d7\u05e8\u05d4",
    "Download Transcript for Editing": "\u05d4\u05d5\u05e8\u05d3 \u05ea\u05de\u05dc\u05d9\u05dc \u05dc\u05e2\u05e8\u05d9\u05db\u05d4",
    "Download URL": "\u05d4\u05d5\u05e8\u05d3 \u05db\u05ea\u05d5\u05d1\u05ea URL",
    "Download available encodings (.csv)": "\u05d4\u05d5\u05e8\u05d3 \u05e7\u05d9\u05d3\u05d5\u05d3\u05d9\u05dd \u05d6\u05de\u05d9\u05e0\u05d9\u05dd (CSV)",
    "Download the user's certificate": "\u05d4\u05d5\u05e8\u05d3 \u05d0\u05ea \u05ea\u05e2\u05d5\u05d3\u05ea \u05d4\u05de\u05e9\u05ea\u05de\u05e9",
    "Draft (Never published)": "\u05d8\u05d9\u05d5\u05d8\u05d4 (\u05de\u05e2\u05d5\u05dc\u05dd \u05dc\u05d0 \u05e4\u05d5\u05e8\u05e1\u05dd)",
    "Draft (Unpublished changes)": "\u05d8\u05d9\u05d5\u05d8\u05d4 (\u05e9\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05e9\u05dc\u05d0 \u05e4\u05d5\u05e8\u05e1\u05de\u05d5)",
    "Drag to reorder": "\u05d2\u05e8\u05d5\u05e8 \u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05e1\u05d3\u05e8 \u05de\u05d7\u05d3\u05e9",
    "Drop target image": "\u05e9\u05d7\u05e8\u05e8 \u05ea\u05de\u05d5\u05e0\u05ea \u05de\u05d8\u05e8\u05d4",
    "Due Date": "\u05ea\u05d0\u05e8\u05d9\u05da \u05e1\u05d9\u05d5\u05dd",
    "Due Date:": "\u05ea\u05d0\u05e8\u05d9\u05da \u05d9\u05e2\u05d3:",
    "Due Time in UTC:": "\u05ea\u05d0\u05e8\u05d9\u05da \u05d9\u05e2\u05d3 \u05d1-UTC:",
    "Due date cannot be before start date.": "\u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05e1\u05d9\u05d5\u05dd \u05d0\u05d9\u05e0\u05d5 \u05d9\u05db\u05d5\u05dc \u05dc\u05d4\u05e7\u05d3\u05d9\u05dd \u05d0\u05ea \u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05d4\u05ea\u05d7\u05dc\u05d4.",
    "Due:": "\u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05d2\u05e9\u05d4",
    "Duplicate": "\u05e9\u05db\u05e4\u05dc",
    "Duration (sec)": "\u05de\u05e9\u05da \u05d6\u05de\u05df (\u05e9\u05e0\u05d9\u05d5\u05ea)",
    "Earned %(created)s.": "\u05d6\u05db\u05d9\u05ea \u05d1-%(created)s.",
    "EdX doesn't have a timed transcript for this video in Studio, but we found a transcript on YouTube. You can import the YouTube transcript or upload your own .srt transcript file.": "\u05d0\u05d9\u05df  \u05ea\u05de\u05dc\u05d9\u05dc edX \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05e2\u05d1\u05d5\u05e8 \u05e1\u05e8\u05d8\u05d5\u05df \u05d5\u05d9\u05d3\u05d0\u05d5 \u05d6\u05d4 \u05d1\u05e1\u05d8\u05d5\u05d3\u05d9\u05d5, \u05d0\u05da \u05de\u05e6\u05d0\u05e0\u05d5 \u05ea\u05de\u05dc\u05d9\u05dc \u05d1\u05d9\u05d5\u05d8\u05d9\u05d5\u05d1. \u05d9\u05e9 \u05d1\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea\u05da \u05dc\u05d9\u05d9\u05d1\u05d0 \u05d0\u05ea \u05ea\u05de\u05dc\u05d9\u05dc \u05d9\u05d5\u05d8\u05d9\u05d5\u05d1 \u05d0\u05d5 \u05dc\u05d4\u05e2\u05dc\u05d5\u05ea \u05d0\u05ea \u05e7\u05d5\u05d1\u05e5 \u05ea\u05de\u05dc\u05d9\u05dc \u05d4-SRT \u05e9\u05dc\u05da.",
    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "\u05d0\u05d9\u05df \u05dc-edX \u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05e2\u05d1\u05d5\u05e8 \u05e1\u05e8\u05d8\u05d5\u05df \u05d5\u05d9\u05d3\u05d0\u05d5 \u05d6\u05d4. \u05e0\u05d0 \u05d4\u05e2\u05dc\u05d4 \u05e7\u05d5\u05d1\u05e5 SRT.",
    "EdX has a timed transcript for this video. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript. If you want to replace this transcript, upload a new .srt transcript file.": "\u05dc-edX \u05e7\u05d9\u05d9\u05dd \u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05e2\u05d1\u05d5\u05e8 \u05e1\u05e8\u05d8\u05d5\u05df \u05d6\u05d4. \u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05e2\u05e8\u05d5\u05da \u05ea\u05de\u05dc\u05d9\u05dc \u05d6\u05d4, \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05d5\u05e8\u05d9\u05d3 \u05d0\u05ea \u05d4\u05e7\u05d5\u05d1\u05e5, \u05dc\u05e2\u05e8\u05d5\u05da \u05d0\u05d5\u05ea\u05d5 \u05d5\u05dc\u05d4\u05e2\u05dc\u05d5\u05ea \u05d0\u05d5\u05ea\u05d5 \u05de\u05d7\u05d3\u05e9. \u05d0\u05dd \u05d1\u05e8\u05e6\u05d5\u05e0\u05da \u05dc\u05d4\u05d7\u05dc\u05d9\u05e3 \u05ea\u05de\u05dc\u05d9\u05dc \u05d6\u05d4, \u05e0\u05d0 \u05d4\u05e2\u05dc\u05d4 \u05e7\u05d5\u05d1\u05e5 \u05ea\u05de\u05dc\u05d9\u05dc SRT \u05d7\u05d3\u05e9. ",
    "EdX has a timed transcript for this video. If you want to replace this transcript, upload a new .srt transcript file. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript.": "\u05dc-edX \u05e7\u05d9\u05d9\u05dd \u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05e2\u05d1\u05d5\u05e8 \u05e1\u05e8\u05d8\u05d5\u05df \u05d6\u05d4. \u05d0\u05dd \u05d1\u05e8\u05e6\u05d5\u05e0\u05da \u05dc\u05d4\u05d7\u05dc\u05d9\u05e3 \u05ea\u05de\u05dc\u05d9\u05dc \u05d6\u05d4, \u05d4\u05e2\u05dc\u05d4 \u05e7\u05d5\u05d1\u05e5 \u05ea\u05de\u05dc\u05d9\u05dc SRT \u05d7\u05d3\u05e9. \u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05e2\u05e8\u05d5\u05da \u05ea\u05de\u05dc\u05d9\u05dc \u05d6\u05d4, \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05d5\u05e8\u05d9\u05d3 \u05d0\u05ea \u05d4\u05e7\u05d5\u05d1\u05e5, \u05dc\u05e2\u05e8\u05d5\u05da \u05d0\u05d5\u05ea\u05d5 \u05d5\u05dc\u05d4\u05e2\u05dc\u05d5\u05ea \u05d0\u05d5\u05ea\u05d5 \u05de\u05d7\u05d3\u05e9. ",
