    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "\u05d0\u05dd \u05ea\u05e2\u05d6\u05d5\u05d1 \u05e2\u05de\u05d5\u05d3 \u05d6\u05d4 \u05dc\u05dc\u05d0 \u05e9\u05de\u05d9\u05e8\u05ea \u05d0\u05d5 \u05e9\u05dc\u05d9\u05d7\u05ea \u05ea\u05e9\u05d5\u05d1\u05ea\u05da, \u05ea\u05d0\u05d1\u05d3 \u05db\u05dc \u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05d1\u05d9\u05e6\u05e2\u05ea \u05d1\u05ea\u05e9\u05d5\u05d1\u05d4.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "\u05d0\u05dd \u05ea\u05e2\u05d6\u05d5\u05d1 \u05e2\u05de\u05d5\u05d3 \u05d6\u05d4 \u05dc\u05dc\u05d0 \u05e9\u05dc\u05d9\u05d7\u05ea \u05d4\u05e2\u05e8\u05db\u05ea \u05e2\u05de\u05d9\u05ea\u05d9\u05da, \u05ea\u05d0\u05d1\u05d3 \u05db\u05dc \u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05d1\u05d9\u05e6\u05e2\u05ea.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "\u05d0\u05dd \u05ea\u05e2\u05d6\u05d5\u05d1 \u05e2\u05de\u05d5\u05d3 \u05d6\u05d4 \u05dc\u05dc\u05d0 \u05e9\u05dc\u05d9\u05d7\u05ea \u05d4\u05d4\u05e2\u05e8\u05db\u05d4 \u05d4\u05e2\u05e6\u05de\u05d9\u05ea \u05e9\u05dc\u05da, \u05ea\u05d0\u05d1\u05d3 \u05db\u05dc \u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05d1\u05d9\u05e6\u05e2\u05ea.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "\u05d0\u05dd \u05ea\u05e2\u05d6\u05d5\u05d1 \u05e2\u05de\u05d5\u05d3 \u05d6\u05d4 \u05dc\u05dc\u05d0 \u05e9\u05dc\u05d9\u05d7\u05ea \u05d4\u05e2\u05e8\u05db\u05ea \u05d4\u05e6\u05d5\u05d5\u05ea \u05e9\u05dc\u05da, \u05ea\u05d0\u05d1\u05d3 \u05db\u05dc \u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05d1\u05d9\u05e6\u05e2\u05ea.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "\u05d0\u05dd \u05d0\u05ea\u05d4 \u05de\u05d1\u05e6\u05e2 \u05e9\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\u05d9\u05dd, \u05d5\u05d3\u05d0 \u05e9\u05d0\u05ea\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2 \u05dc\u05d7\u05d1\u05e8\u05d9 \u05d4\u05e6\u05d5\u05d5\u05ea \u05dc\u05e4\u05e0\u05d9 \u05d1\u05d9\u05e6\u05d5\u05e2 \u05e9\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05d0\u05dc\u05d4.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "\u05d0\u05dd \u05ea\u05d4\u05e4\u05d5\u05da \u05d0\u05ea %(xblockType)s \u05dc\u05d2\u05dc\u05d5\u05d9 \u05dc\u05dc\u05d5\u05de\u05d3\u05d9\u05dd, \u05d9\u05d5\u05db\u05dc\u05d5 \u05d4\u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05ea\u05d5\u05db\u05e0\u05d5 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d7\u05dc\u05e3 \u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05d4\u05e4\u05e6\u05d4 \u05d5\u05e4\u05e8\u05e1\u05d5\u05dd  \u05d4\u05d9\u05d7\u05d9\u05d3\u05d4. \u05e8\u05e7 \u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05d4\u05e0\u05e1\u05ea\u05e8\u05d5\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05e4\u05d5\u05e8\u05e9 \u05de\u05e4\u05e0\u05d9 \u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05d9\u05e9\u05d0\u05e8\u05d5 \u05e0\u05e1\u05ea\u05e8\u05d5\u05ea \u05dc\u05d0\u05d7\u05e8 \u05e9\u05ea\u05d5\u05e8\u05d9\u05d3 \u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05d6\u05d5 \u05de\u05d4-%(xblockType)s.",
