    "Started rescore problem task for problem '<%- problem_id %>' and student '<%- student_id %>'. Click the 'Show Task Status' button to see the status of the task.": "\u05d4\u05d5\u05e4\u05e2\u05dc\u05d4 \u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05d7\u05d9\u05e9\u05d5\u05d1 \u05e6\u05d9\u05d5\u05e0\u05d9\u05dd \u05de\u05d7\u05d3\u05e9 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4  '<%- problem_id %>' \u05d5\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8  '<%- student_id %>'. \u05dc\u05d7\u05e5 \u05e2\u05dc \u05dc\u05d7\u05e6\u05df '\u05d4\u05e6\u05d2 \u05e1\u05d8\u05d8\u05d5\u05e1 \u05de\u05e9\u05d9\u05de\u05d5\u05ea' \u05db\u05d3\u05d9 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05e1\u05d8\u05d8\u05d5\u05e1 \u05d4\u05de\u05e9\u05d9\u05de\u05d4.",
