    "Success! Problem attempts reset for problem '<%- problem_id %>' and student '<%- student_id %>'.": "\u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d0\u05d9\u05e4\u05d5\u05e1 \u05e0\u05d9\u05e1\u05d9\u05d5\u05e0\u05d5\u05ea \u05e2\u05d1\u05d5\u05e8 \u05d4\u05dc\u05d5\u05de\u05d3 \u05d4\u05e1\u05ea\u05d9\u05d9\u05de\u05d4 \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4!\" '<%- problem_id %>' \u05d5\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '<%- student_id %>'.",
