    "Successfully rescored problem for user {user}": "\u05d4\u05d5\u05e9\u05dc\u05dd \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4 \u05de\u05ea\u05df \u05e6\u05d9\u05d5\u05df \u05de\u05d7\u05d3\u05e9 \u05e2\u05d1\u05d5\u05e8 \u05de\u05e9\u05ea\u05de\u05e9  {user}",
    "Successfully rescored problem to improve score for user {user}": "\u05d4\u05d5\u05e9\u05dc\u05dd \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4 \u05de\u05ea\u05df \u05e6\u05d9\u05d5\u05df \u05de\u05d7\u05d3\u05e9 \u05dc\u05d1\u05e2\u05d9\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05de\u05e9\u05ea\u05de\u05e9  {user}",
