    "Upload a comma separated values (.csv) file that contains the usernames or email addresses of learners who have been given exceptions. Include the username or email address in the first comma separated field. You can include an optional note describing the reason for the exception in the second comma separated field.": "\u05d4\u05e2\u05dc\u05d4 \u05e7\u05d5\u05d1\u05e5 (\u200ecsv) \u05e2\u05e8\u05db\u05d9\u05dd \u05d4\u05de\u05d5\u05e4\u05e8\u05d3\u05d9\u05dd \u05d1\u05e4\u05e1\u05d9\u05e7, \u05d4\u05de\u05db\u05d9\u05dc \u05d0\u05ea \u05e9\u05de\u05d5\u05ea \u05d4\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05d5\u05ea \u05d4\u05d3\u05d5\u05d0\u05e8 \u05d4\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9 \u05e9\u05dc \u05d4\u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05e9\u05e7\u05d9\u05d1\u05dc\u05d5 \u05d7\u05e8\u05d9\u05d2\u05d5\u05ea. \u05db\u05dc\u05d5\u05dc \u05d0\u05ea \u05e9\u05dd \u05d4\u05de\u05e9\u05ea\u05de\u05e9 \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05ea \u05d4\u05d3\u05d5\u05d0\u05e8 \u05d4\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9 \u05d1\u05e2\u05de\u05d5\u05d3 \u05d4\u05de\u05d5\u05e4\u05e8\u05d3 \u05d1\u05e4\u05e1\u05d9\u05e7 \u05d4\u05e8\u05d0\u05e9\u05d5\u05df. \u05d1\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea\u05da \u05dc\u05db\u05dc\u05d5\u05dc \u05d4\u05e2\u05e8\u05d4 \u05d0\u05d5\u05e4\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05ea \u05d4\u05de\u05ea\u05d0\u05e8\u05ea \u05d0\u05ea \u05d4\u05e1\u05d9\u05d1\u05d4 \u05dc\u05d7\u05e8\u05d9\u05d2\u05d4 \u05d1\u05e9\u05d3\u05d4 \u05d4\u05de\u05d5\u05e4\u05e8\u05d3 \u05d1\u05e4\u05e1\u05d9\u05e7 \u05d4\u05e9\u05e0\u05d9.",
